import Dashboard from 'pages/Dashboard';
import Home from 'pages/Home';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

function Routes() {
    return (
        <div >
            <BrowserRouter>
                <Switch>
                    <Route path="/" exact >
                        <Home />
                    </Route>
                    <Route path="/dashboard" exact >
                        <Dashboard />
                    </Route>
                </Switch>
            </BrowserRouter>
        </div >
    );
}

export default Routes;
